INSERT INTO `clt_xw` VALUES (47,'资产双通证上线运营时间',9,'','',1552531638,20,0,'<p>Distinguished members of the new media community:</p><p>After USA NMCT/XMT assets dual-pass platform is officially operational! Welcome to the Global Market Community Team! Enter digital asset management! Build your own team quickly!</p><p><br></p><p><br></p><p>ด้วยความเคารพสมาชิก : สื่อใหม่ในชุมชน</p><p>สหรัฐอเมริกา / สินทรัพย์ / NMCT XMT คู่ผ่านแพลตฟอร์มการดำเนินงานอย่างเป็นทางการแล้ว ! ! ! ! ! ! ! ยินดีต้อนรับสู่โลกของชุมชนตลาดเมื่อเข้าร่วมทีม ! ! ! ! ! ! ! ในการจัดการสินทรัพย์ดิจิตอล ! ! ! ! ! ! ! ได้อย่างรวดเร็วสร้างทีมของตนเอง ! ! ! ! ! ! !</p><p><br></p><p>尊敬的新媒体社区的成员：</p><p>USA NMCT/XMT资产双通证平台正式进行运营后！届时欢迎全球市场社区团队加入！进入数字资产管理！快速组建自己的团队！</p>','全球资产双通证平台于公历2019年3月16日正式上线运营！',49);
INSERT INTO `clt_xw` VALUES (51,'资产双通证对接各大电商体系公告',9,'','',1552573717,21,0,'<p>Distinguished members of the new media community:</p><p>USA New Media Mall docking about the purchase of goods in Taobao, Jingdong and Pingduo Mall. Due to the API multi-interface link problem, the mall is in the first stage of debugging system. It is not open for members to purchase for the time being. The whole mall system will officially open the NMCT/XMT purchase function on May 1, 2019.</p><p><br></p><p>ด้วยความเคารพสมาชิกชุมชนใหม่ของสื่อ :</p><p>สหรัฐอเมริกาสื่อใหม่ที่ก้นของ Taobao มอลล์ , ตะวันออก , กันมากขึ้น ' ' สินค้าในร้านที่ซื้อเพราะ API หลายอินเตอร์เฟซการเชื่อมโยงปัญหาห้างนี้มีขั้นตอนการแก้จุดบกพร่องระบบที่หนึ่งชั่วคราวที่ไม่เปิดให้สมาชิกซื้อห้างทั้งระบบจะเปิดอย่างเป็นทางการในวันที่ 1 พฤษภาคมพ.ศ. 2562 XMT NMCT / การทำงานของการซื้อ ! ! ! ! ! ! !</p><p><br></p><p><br></p><p>尊敬的新媒体社区的成员们：</p><p>USA 新媒体商城对接的关于淘宝、’京东、拼多多商城内的商品购买，由于API多接口链接问题，该商城正属于调试系统第一阶段，暂时不开放会员购买，整个商城体系将于2019年5月1号正式开通NMCT/XMT购买功能！</p>','资产双通证对接各大电商体系公告',49);
INSERT INTO `clt_xw` VALUES (53,'资产双通证平台2019年3月28日正式开通交易中心',9,'','',1553747490,19,1,'<p><p><span>Notices for New Media Assets Double Pass Platform Transaction in the United States</span></p></p><p><span>1. Sales and sales are all $8 discount. Both buyers and sellers need to make a payment within 120 minutes and complete the confirmation. If there is a malicious transaction, no payment or confirmation for more than 120 minutes, the account will be permanently frozen! The time to register for sale is T+2 (within 72 hours)</span></p><p><span>2. Fill in the real and valid wallet address and bank card! If the transaction is unsuccessful as usual, users need to check their wallet address and bank card number in time.</span></p><p><span>3. User transactions need to submit normal payment vouchers to facilitate the seller's inspection and confirmation!</span></p><p><span>4. Supporting UnionPay, VIS card, digital currency USDT and some bank transactions have been opened and used one after another.</span></p><p><span>5. Users should fill in their real and valid names and bank card numbers when registering and modifying. In order to avoid abnormal transactions!</span></p><p><span>6. Users need to set up the personal information of the account to improve! Such as: bank card, wallet address, security password and so on.</span></p><p></p><p><span>Thank you again to the members of the global community of new media in the United States! Welcome to the trading center!</span></p><p><span><br></span></p><p><span>ข้อควรระวังในการซื้อขายสินทรัพย์ใหม่ของสื่ออเมริกัน</span></p><p><span>ผู้ซื้อและผู้ขายจะต้องพิมพ์เงินใน 120 นาทีและเสร็จสิ้นการยืนยันหากผู้ใช้ไม่ได้รับการยืนยันธุรกรรมที่เป็นอันตรายมากกว่า 120 นาทีบัญชีจะถูกแช่แข็งอย่างถาวร ค้างไว้และขายจนกว่าจะถึงเวลาบัญชี</span></p><p><span>กรุณากรอกที่อยู่กระเป๋าสตางค์ที่ถูกต้องและบัตรธนาคาร ถ้าเหตุผลของผู้ใช้ธุรกรรมตามปกติไม่ประสบความสำเร็จผู้ใช้ต้องตรวจสอบกระเป๋าเงินของพวกเขาที่อยู่และหมายเลขบัตรธนาคารในเวลา</span></p><p><span>ผู้ใช้จะต้องส่งหลักฐานการชำระเงินปกติสำหรับการตรวจสอบและการยืนยันของผู้ขาย</span></p><p><span>สนับสนุนวีซ่าสนับสนุนวีซ่าสนับสนุนสกุลเงินดิจิตอล USD และบางส่วนของธุรกรรมธนาคารเปิด</span></p><p><span>กรุณากรอกชื่อที่ถูกต้องและหมายเลขบัตรเมื่อลงทะเบียนและแก้ไข เพื่อหลีกเลี่ยงการซื้อขายที่ผิดปกติ</span></p><p><span>ผู้ใช้จะต้องตั้งค่าข้อมูลส่วนบุคคลที่สมบูรณ์แบบสำหรับบัญชีนี้ เช่นบัตรธนาคารที่อยู่กระเป๋าสตางค์รหัสผ่านการรักษาความปลอดภัยฯลฯ</span></p><p></p><p><span>ขอบคุณอีกครั้งสำหรับสมาชิกของชุมชนทั่วโลกของสื่อใหม่ของอเมริกา ยินดีต้อนรับสู่ศูนย์ธุรกิจการค้า</span></p><p><span><br></span></p><p><span><br></span></p><p><p><span>美国新媒体资产双通证平台交易注意事项</span></p><p><p><span>1.买卖都是美金8折挂卖，买卖双方均需要在120分钟内打款并完成确认，如有用户恶意交易，超过120分钟没有打款或没有确认的，账号会被永久冻结！挂卖到账时间为T+2（72小时内）<br></span><p><span>2.填写真实有效钱包地址和银行卡！如用户的原因照常交易不成功，用户需要及时查看核对自己的钱包地址和银行卡卡号。<br></span><p><span>3.用户交易需提交正常打款凭证，以方便卖方查看及确认！</span><br><p>4.支持银联、支持VIS卡、支持数字货币USDT、部分银行交易陆续开通使用！<br><p>5.用户注册和修改时需填写真实有效姓名和银行卡号！以免出现交易不正常！<br><p>6.用户需设置该账户的个人信息的完善！列如：银行卡、钱包地址、安全密码等等。</p><p>再次感谢美国新媒体的全球社区的成员们！欢迎大家来交易中心交易！</p></p></p></p></p></p></p></p>','资产双通证平台2019年3月28日正式开通交易中心！所有社区成员正常进入买卖',49);
